import axios from "axios"
import { useEffect, useState } from "react"

const PokeCard = ({data}) => {

    const [currentPokemon, setCurrentPokemon] = useState()

    useEffect(() => {
        axios
            .get(data[0].url)
            .then(res => setCurrentPokemon(res.data))
    }, [data]);

    return (
        <div>
            {
            currentPokemon && 
            <div>
                Hello {currentPokemon.name}!
            </div>
            }

        </div>
    )
} 

export default PokeCard
